INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (161488420528,'1000 Schilling von 1966 in sehr gutem Zustand',34461,'1010','Oostenrijk','AT','vollgas2014','4.94','EUR','','img161488420528.jpg','<p><font face="Arial" size="4">Sammlungsauflösung,daher Privatverkauf,keine Garantie,keine Rücknahme,bei berechtigten Beanstandungen nehme ich Artikel jedoch zurück.</font></p><p><font face="Arial" size="4">Viele weitere Stücke gerne auf Anfrage.</font></p><p><font face="Arial" size="4">Zur Auswahl stehen folgende Versandarten:Einschreibeversand,unversicherter Versand,versicherter Versand sowie Wertbrief und Paket.</font></p><p><font face="Arial" size="4">Einschreibeversand ist als Standard festgelegt,sollten Sie eine andere angebotene Versandart wünschen bitte vorher anfragen,bitte jedoch dabei zu beachten dass bei unversichertem Versand der KÄUFER das volle Verlustrisiko trägt,genauso wenn ein Einschreibebrief der Post abhanden kommt und die Ware mehr wert sein sollte.</font></p><p><font face="Arial" size="4">Daher wird bei höheren Werten auch der versicherte&nbsp;Wertbriefversand empfohlen.</font></p><p>&nbsp;</p><p><font face="Arial" size="4">Bezahlung muss binnen 5 Tagen ab Auktionsende erfolgen,ab dem 6.Tag ohne Bezahlung wird der Artikel als "nicht bezahlt" gekennzeichnet,ab dem 10.Tag ohne Bezahlung wird der offene Fall geschlossen und Sie verlieren jeglichen Anspruch an dem/den Artikel/n,mit Abgabe Ihres Gebotes gilt dies als vereinbart.</font></p><p><font face="Arial" size="4">Viel Spass beim bieten.</font></p>')
